&lt;p&gt;Two statements are given, followed by three conclusions numbered I, II and III. Assuming the statement to be true even if they seem to be at variance with commonly known facts, decide which of the conclusions logically follow(s) from the statements.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;Statements:&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;Some quadrilateral are squares.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

