&lt;p&gt;Conclusions:&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;I. No quadrilateral is a rhombus.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;II. All rhombuses are squares.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;
III. Some quadrilaterals are rhombuses.

